			shellScript = "# IMPORTANT:\n# Change the id's BEFORE linking, so that the revised install names are picked up and used for InchmanExec.\n# Given that we don't store the expanded libs in the svn repository, a change here shouldn't matter.\ninstall_name_tool -id \"@rpath/libsbml.4.3.1.dylib\" \"${TARGET_NAME}/libsbml/lib/libsbml.4.3.1.dylib\"\ninstall_name_tool -id \"@rpath/Python.framework/Versions/2.7/Python\" \"${TARGET_NAME}/Python.framework/Versions/2.7/Python\"\ninstall_name_tool -id \"@rpath/libboost_log.dylib\" \"${TARGET_NAME}/boost/lib/libboost_log.dylib\"\ninstall_name_tool -id \"@rpath/libboost_program_options.dylib\" \"${TARGET_NAME}/boost/lib/libboost_program_options.dylib\"\ninstall_name_tool -id \"@rpath/libboost_python.dylib\" \"${TARGET_NAME}/boost/lib/libboost_python.dylib\"\ninstall_name_tool -id \"@rpath/libboost_system.dylib\" \"${TARGET_NAME}/boost/lib/libboost_system.dylib\"\ninstall_name_tool -id \"@rpath/libboost_date_time.dylib\" \"${TARGET_NAME}/boost/lib/libboost_date_time.dylib\"\ninstall_name_tool -id \"@rpath/libboost_filesystem.dylib\" \"${TARGET_NAME}/boost/lib/libboost_filesystem.dylib\"\n\n# for some reason (TODO: fix that..) the boost shared libs are linked against the system python framework so we need to change\n# that.\ninstall_name_tool -change /System/Library/Frameworks/Python.framework/Versions/2.7/Python @rpath/Python.framework/Versions/2.7/Python \"${TARGET_NAME}/boost/lib/libboost_python.dylib\"\n";
